(3963, 'en', 'default', '1283a7fcac8dc097b0875b6a7290af01', 'The fields on this screen determine some of the basics of your site setup.', NULL, 'LINE', NULL, 0, '', 'da995ca09f039985d226591412a088b0'),
(3964, 'en', 'default', 'f5edc853e96c1ea8b465c7ab39769ca3', 'Most themes display the site title at the top of every page, in the title bar of the browser, and as the identifying name for syndicated feeds. The tagline is also displayed by many themes.', NULL, 'LINE', NULL, 0, '', 'a516610b2a4c609cdd98fb0de2c64939'),
(3965, 'en', 'default', '68804ce6aa38ab1ef7d4e33889033f7b', 'The WordPress URL and the Site URL can be the same (example.com) or different; for example, having the WordPress core files (example.com/wordpress) in a subdirectory instead of the root directory.', NULL, 'LINE', NULL, 0, '', '611f402fad36bf6c2938669e03586d18'),
(3966, 'en', 'default', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', NULL, 'LINE', NULL, 0, '', '1e0104cd42ac1e2fe540ba466d5ff248'),
(3967, 'en', 'default', '8f52d6a439157f46ebbd2782a6ce2a22', 'You can set the language, and the translation files will be automatically downloaded and installed (available if your filesystem is writable).', NULL, 'LINE', NULL, 0, '', '308e8d0b6f06c46087b020dda71cb159'),
