(4892, 'en', 'default', '562a2da5ecf13083d751ce8dd9905d10', 'You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.', NULL, 'LINE', NULL, 0, '', 'f86ab1682d11f3bf7e8923776b1c375c'),
