(4947, 'en', 'default', '8860791c508f1a9cd582441eb31955b7', 'Custom Structure', NULL, 'LINE', NULL, 0, '', '445f5434033c7a4db61a18d146b4d318'),
(4948, 'en', 'default', 'ebb061953c0454b2c8ee7b0ac615ebcd', 'Optional', NULL, 'LINE', NULL, 0, '', '529fec214c83ccc13ea9f2b9982da799'),
(4949, 'en', 'default', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', NULL, 'LINE', NULL, 0, '', 'd635a782b4c7393661373e724751b36c'),
