(301, '_transient_dash_bd94b8f41e74bae2f4dc72e9bd8379af', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/WordpressFrancophone/~3/5e8SDCecxmc/''>Un nouveau site pour WordPress Francophone</a> <span class="rss-date">15 septembre 2016</span><div class="rssSummary">Après plus de quatre mois de chantier, nous sommes fiers de vous présenter le nouveau site WPFR ! Nous l’avions annoncé en mai, le site de l’association était en cours de refonte, l’ancien étant dépassé tant en termes d’aspect que de fonctionnalités. Une quinzaine de bénévoles ont répondu à notre appel pour travailler avec nous sur ce projet. Cette entreprise a aujourd’hui porté [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/1AcQNbF6oUs/''>Quel est le meilleur thème ThemeForest de 2016 ?</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/a5SQNVdn0ZA/''>Vous devriez postuler pour être volontaire au WordCamp Europe 2017 !</a></li><li><a class=''rsswidget'' href=''http://feedproxy.google.com/~r/wpfr/~3/xm246_gVRNc/''>Migrer son site WordPress facilement avec Duplicator</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Extensions populaires :</span> Clef Two-Factor Authentication&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=wpclef&amp;_wpnonce=ae12409632&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Installer Clef Two-Factor Authentication">(Installer)</a></li></ul></div>', 'no');
